var { MongoClient } = require('mongodb');

var mongoUrl = Secrets.get('mongoUrl').valueOf();

md`
### **Package:** [mongodb](http://npmjs.com/mongodb) ![npm](https://img.shields.io/npm/v/mongodb)

When using mongodb, you must open and close the connect in the same block.
~~~javascript
const client = new MongoClient(mongoUrl);
await client.connect();
const db = client.db('nbook-demo');

{... make some queries ...}

await client.close();
~~~

Here we are using the oficial nodejs mongodb client.

We will connect to the url ${md.code(mongoUrl)} and fetch and count all documents from the ${md.code('demo')} collection.
`

const client = new MongoClient(mongoUrl);
await client.connect();
const db = client.db('nbook-demo');
const data = await db.collection('demo').find({}).toArray();
const count = await db.collection('demo').count({});

md`
There are **${count}** documents in the database.
`

table(data);

await client.close();

